import React from 'react';
import { Button } from "@react-md/button";
import { FontIcon } from "@react-md/icon";
import { DeleteSVGIcon, FavoriteSVGIcon } from "@react-md/material-icons";

export class C_Button extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Button
            id="icon-button-1"
            buttonType="icon"
            theme="primary"
            aria-label="Favorite"
            >
                <FontIcon>{this.props.icon}</FontIcon>
            </Button>
        )
    }
}

export class C_Icon extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Button
            id="icon-button-1"
            buttonType="icon"
            theme="primary"
            aria-label="Favorite"
            >
                <FontIcon>{this.props.icon}</FontIcon>
            </Button>
        )
    }
}
